import HomePage from './pages/HomePage';

function App() {
  return (
    <div className="App">
      <h1>My Awesome blog</h1>
      <div id="page-body">
        <HomePage />
        <AboutPage />
        <ArticlesListPage />
        <ArticlePage />
      </div>
    </div>
  );
}

export default App;
